// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

// Interface for DeFi Protocol interaction
interface IDeFiProtocol {
    function stake(uint256 amount) external;
    function withdraw(uint256 amount) external;
    function getYield(uint256 amount, uint256 duration) external view returns (uint256);
}

// Interface for Basename Service (replace with actual service if needed)
interface IBaseNames {
    function getName(address user) external view returns (string memory);
}

// Interface for Smart Wallet Service
interface ISmartWallet {
    function performTransaction(address target, bytes calldata data) external;
}

contract DeChange is ERC721URIStorage, Ownable, ReentrancyGuard {
    using Counters for Counters.Counter;
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.AddressSet;

    Counters.Counter private _tokenIdCounter;
    IERC20 public rewardToken; // Token used for rewards
    IDeFiProtocol public defiProtocol;
    IBaseNames public baseNameService;
    ISmartWallet public smartWallet;

    struct Course {
        uint256 courseId;
        string title;
        uint256[] steps;
        bool completed;
        bool claimed;
    }

    struct StakeInfo {
        uint256 amount;
        uint256 startTime;
        bool isStaking;
    }

    struct User {
        address wallet;
        mapping(uint256 => Course) courses;
        uint256 performance;
        StakeInfo stake;
    }

    mapping(address => User) public users;
    EnumerableSet.AddressSet private activeStakers;

    event CourseEnrolled(address indexed user, uint256 courseId);
    event TaskCompleted(address indexed user, uint256 courseId, uint256 taskId, string taskType);
    event CourseCompleted(address indexed user, uint256 courseId, uint256 reward);
    event SBTMinted(address indexed user, uint256 tokenId);
    event TokensStaked(address indexed user, uint256 amount, uint256 startTime);
    event YieldDistributed(address indexed user, uint256 yieldAmount);
    event DeFiProtocolSet(address indexed protocol);
    event BaseNameValidated(address indexed user, string baseName);
    event TransactionViaSmartWallet(address indexed user, address target);

    constructor(address _rewardToken, address _baseNameService, address _smartWallet) ERC721("DeChange SBT", "DCSBT") {
        rewardToken = IERC20(_rewardToken);
        baseNameService = IBaseNames(_baseNameService); // Set Basenames contract address
        smartWallet = ISmartWallet(_smartWallet); // Set Smart Wallet contract address
    }

    // Register for a course
    function enrollInCourse(uint256 courseId, string memory title, uint256[] memory steps) external {
        require(users[msg.sender].courses[courseId].courseId == 0, "Already enrolled");
        users[msg.sender].courses[courseId] = Course({
            courseId: courseId,
            title: title,
            steps: steps,
            completed: false,
            claimed: false
        });
        emit CourseEnrolled(msg.sender, courseId);
    }

    // Complete a task and record progress
    function completeTask(uint256 courseId, uint256 taskId, string memory taskType) external {
        require(!users[msg.sender].courses[courseId].completed, "Course already completed");
        require(taskId < users[msg.sender].courses[courseId].steps.length, "Invalid task ID");

        users[msg.sender].courses[courseId].steps[taskId] = 1; // Mark step as completed

        emit TaskCompleted(msg.sender, courseId, taskId, taskType);
    }

    // Complete the course and earn rewards
    function completeCourse(uint256 courseId) external {
        require(!users[msg.sender].courses[courseId].completed, "Already completed");

        uint256 performanceScore = calculatePerformance(msg.sender, courseId);
        users[msg.sender].performance += performanceScore;

        users[msg.sender].courses[courseId].completed = true;
        users[msg.sender].courses[courseId].claimed = true;

        emit CourseCompleted(msg.sender, courseId, performanceScore);
    }

    // Calculate dynamic rewards based on task completion
    function calculatePerformance(address user, uint256 courseId) internal view returns (uint256) {
        uint256 totalTasks = users[user].courses[courseId].steps.length;
        uint256 completedTasks = 0;

        for (uint256 i = 0; i < totalTasks; i++) {
            if (users[user].courses[courseId].steps[i] == 1) {
                completedTasks++;
            }
        }
        return (completedTasks * 100) / totalTasks;
    }

    // Mint an SBT as a course completion credential
    function mintSBT(string memory tokenURI) external {
        require(users[msg.sender].performance > 0, "No performance recorded");

        _tokenIdCounter.increment();
        uint256 newTokenId = _tokenIdCounter.current();

        _mint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, tokenURI);

        emit SBTMinted(msg.sender, newTokenId);
    }

    // Stake tokens
    function stakeTokens(uint256 amount) external nonReentrant {
        require(amount > 0, "Amount must be greater than zero");
        rewardToken.safeTransferFrom(msg.sender, address(this), amount);

        StakeInfo storage stake = users[msg.sender].stake;
        stake.amount += amount;
        stake.startTime = block.timestamp;
        stake.isStaking = true;

        activeStakers.add(msg.sender);
        defiProtocol.stake(amount);

        emit TokensStaked(msg.sender, amount, block.timestamp);
    }

    // Distribute yield to the stakers
    function distributeYield() external nonReentrant {
        StakeInfo storage stake = users[msg.sender].stake;
        require(stake.isStaking, "No tokens staked");

        uint256 stakingDuration = block.timestamp - stake.startTime;
        uint256 yieldAmount = defiProtocol.getYield(stake.amount, stakingDuration);

        rewardToken.safeTransfer(msg.sender, yieldAmount);
        emit YieldDistributed(msg.sender, yieldAmount);
    }

    // Withdraw staked tokens and yield
    function withdrawStake() external nonReentrant {
        StakeInfo storage stake = users[msg.sender].stake;
        require(stake.isStaking, "No tokens staked");

        uint256 stakingDuration = block.timestamp - stake.startTime;
        uint256 yieldAmount = defiProtocol.getYield(stake.amount, stakingDuration);

        defiProtocol.withdraw(stake.amount);
        rewardToken.safeTransfer(msg.sender, yieldAmount);

        stake.amount = 0;
        stake.startTime = 0;
        stake.isStaking = false;

        activeStakers.remove(msg.sender);
        emit YieldDistributed(msg.sender, yieldAmount);
    }

    // Set the DeFi protocol for staking
    function setDeFiProtocol(address _defiProtocol) external onlyOwner {
        defiProtocol = IDeFiProtocol(_defiProtocol);
        emit DeFiProtocolSet(_defiProtocol);
    }

    // Get staking information
    function getStakingInfo(address user) external view returns (uint256, uint256, bool) {
        StakeInfo storage stake = users[user].stake;
        return (
            stake.amount,
            stake.startTime,
            stake.isStaking
        );
    }

    // **Basename Integration**
    function validateBaseNameOwnership(address user, string memory expectedBasename) public view returns (bool) {
        string memory basename = baseNameService.getName(user);
        return keccak256(abi.encodePacked(basename)) == keccak256(abi.encodePacked(expectedBasename));
    }

    function checkUserBasename(address user) external view returns (string memory) {
        return baseNameService.getName(user);
    }

    // **Smart Wallet Integration**
    function executeFromSmartWallet(address target, bytes calldata data) external {
        smartWallet.performTransaction(target, data);
        emit TransactionViaSmartWallet(msg.sender, target);
    }
}

